    // function stake() external {
    //     require(balances[msg.sender] >= stakeAmount, "Not enough tokens");

    //     balances[msg.sender] -= stakeAmount;
    //     balances[owner] += stakeAmount;
    //     stakeList[msg.sender] = stakeAmount;
    // }

}

